import React from 'react'

export default function Popup(props) {
  return (props.trigger) ? (
    <div className='popup'>
        <div className='innerpop'>
            <button className='close' onClick={() => props.setTrigger(false)}></button>
            {props.children}
        </div>
    </div>
  ) : "";
}
